const styles = theme => ({
  label: {
    writingMode: "vertical-rl",
    textOrientation: "upright",
    borderRight: theme.border,
    fontSize: "30px"
  },
  titles: {
    height: "40vh",
    paddingLeft: "10vw"
  },
  grid: {
    marginLeft: "auto",
    marginRight: "auto",
    paddingTop: "5vh"
  }
});

export default styles;
